    <style>
        body{
            background-color: black;
            font-family: Arial, Helvetica, sans-serif;
        }

        .title{
            border-radius: 5px;
            background-color: white;
            position: absolute;
            top: 5%;
            left: 50%;
            transform: translateX(-50%);
            transition: all 0.4s;
            width: 55vw;
        }

        .title:hover{
            scale: 1.02;
        }

        .buttons{
            position: absolute;
            bottom: 10%;
            left: 50%;
            width: max-content;
            transform: translate(-50%,-50%);
            text-align: center;
        }

        button{
            padding: 3px;
            border-radius: 20px;
            border: none;
            background-color: white;
            color: black;
            transition: all 0.4s;
        }

        button:not(:disabled):hover{
            scale: 1.1;
        }

        button:disabled{
            background-color: #232323;
            color: grey;
        }
    </style>
